import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios'; // Import axios for making HTTP requests
import './Admin.css';

function Admin() {
  const navigate = useNavigate();
  const [numberOfColumns, setNumberOfColumns] = useState(0);
  const [responseData, setResponseData] = useState([]);

  const handleAdminClick = () => {
    // Redirect to the Admin page
    navigate('/admin');
  };

  const handleCreateTable = async () => {
    // Fetch data from API using PLZ entered in the text field
    try {
      const response = await axios.post(
        'https://9xna35s7vi.execute-api.eu-central-1.amazonaws.com/dev/admin/getuserbyzipcode',
        {
          "PLZ": document.getElementById("plzField").value // Get PLZ from text field
        },
        {
          headers: {
            'Authorization': 123 // Replace with your authorization token
          }
        }
      );
      setResponseData(response.data); // Set response data in state
    } catch (error) {
      console.error('Error fetching data:', error);
    }
  };

  return (
    <div className="Admin">
      <h1>Welcome to the Admin Page</h1>
      <button onClick={handleAdminClick}>Go to Admin Page</button>
      <div>
        <input
          type="number"
          id="plzField"
          placeholder="Enter PLZ"
          value={numberOfColumns}
          onChange={(e) => setNumberOfColumns(parseInt(e.target.value))}
        />
        <button onClick={handleCreateTable}>Fetch Data</button>
      </div>
      <table>
        <thead>
          <tr>
            {Object.keys(responseData[0] || {}).map((key) => (
              <th key={key} scope="col">{key}</th>
            ))}
          </tr>
        </thead>
        <tbody>
          {responseData.map((item, index) => (
            <tr key={index}>
              {Object.values(item).map((value, index) => (
                <td key={index}>{value}</td>
              ))}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default Admin;
